    def table_preparation(self):
        import pandas as pd
        
        #Detect the first number duplicate and eliminate it
        from collections import Counter
        
        for x in range(6):
           element_counts = Counter(file_numbers)
           first_duplicate = next((num for num, count in element_counts.items() if count > 1), None)
           print(f"Removed element: {first_duplicate}")
           if first_duplicate is not None:
              positions_to_remove = [index for index, num in enumerate(file_numbers) if num == first_duplicate]
              positions_to_remove = positions_to_remove[0]
              file_numbers.remove(first_duplicate)
              print(f"Removed element in path: {positions_to_remove}")
              del file_paths[positions_to_remove]
              print(file_paths)
              print(file_numbers)
              if x == 6:
                 print("Matrices directories up-to-dated")
        
	
        sorted_vector = [x for _, x in sorted(zip(file_numbers, file_paths))]
        
        while len(sorted_vector) < 6:
            sorted_vector.append("X")
        
        print(input_index)
        print(input_analysis)
        print(input_type)
        print(input_integration)
        print(input_label)
        print(input_selection)
        print(sorted_vector)
        
        
        df = pd.DataFrame(
            list(
                zip(
                    input_index,
                    input_analysis,
                    input_type,
                    input_integration,
                    input_label,
                    input_selection,
                    sorted_vector
                )
            ),
            columns=[
                "INDEX",
                "ANALYSIS",
                "DATA_TYPE",
                "INTEGRATION",
                "LABEL",
                "SELECTION",
                "DIRECTORIES"
            ],
        )
        print("BIOMIX_INPUT_DATA")
        print(df)
        df.to_csv("COMMANDS.tsv", sep="\t")

